import React, { useState } from "react";
import {Link, useNavigate } from 'react-router-dom'
import Login from "./Login";
import NoTickets from '../account/NoTickets.jsx';
import ggl from '../../assets/home/icons/CheckIn/google.svg'
import { useDispatch,useSelector } from "react-redux";
import { useSignUpMutation } from "../../slices/usersApiSlice.js";
import { toast } from "react-toastify";

import {signUpUser} from '../../slices/authSlice.js';


export default  function CreateAccount () {

const [email,setEmail] = useState('');
const [password,setPassword] = useState('');
const [username,setUsername] = useState('');

const dispatch = useDispatch();
const navigate = useNavigate();

const [signUp,{isLoading}] = useSignUpMutation();

const {userInfo} = useSelector((state)=> state.auth);

const handleSubmit = async(e) => {

    e.preventDefault();

    try {
        const response = await signUp({ email, password, username }).unwrap();
        dispatch(signUpUser);
        toast.success("Sign Up successful");
        navigate("/");
    } catch (error) {
        toast.error(error.data?.message || "Sign up failed");
    }

   }

return(

   <section className="auth">
            <h1>Create Account</h1>
            <form 
                onSubmit={handleSubmit}
            >
                <label for="name">Name and Surname</label>
                    <input 
                        value={username}
                        name="name"  
                        placeholder="Enter your name and surname"
                        onChange={(e)=> setUsername(e.target.value)}
                    />

                <label>Email Address</label>
                    <input
                        type="email"
                        name="email"
                        onChange={(e)=> setEmail(e.target.value)}
                        value={email}
                        placeholder="Enter your email address"
                    />
                <label>Password</label>
                <input 
                    type="password"
                    name="password"
                    aria-describedby="password"
                    aria-invalid="false"
                    onChange={(e)=> setPassword(e.target.value)}
                    value={password}
                    placeholder="Enter your password"
                />

                <section className="checkbox">
                    <input required type="checkbox"/> 
                    <p>
                        I agree with <span className="highlight">Terms</span> and{" "}
                        <span className="highlight">Privacy</span>
                    </p>
                </section>
                
                    <section className="form" method='get'>
                            <button 
                            className="general_btn"
                             type="submit"
                            disabled={isLoading}> <span>{isLoading ? "Loading.." : "Sign Up"}</span> </button>
                            <p>or</p>
                        <button 
                        className="btn_ggl_submit" 
                        type="submit"
                         placeholder="Sign Up with Google"> 
                            <img src={ggl} alt="signIn with Google"/> 
                            <span>Sign In with Google</span>  
                        </button>
                    <section className="additionals">
                        <p>Already have an account?</p>
                            <Link to='/auth/login'element={<Login/>}>
                                <button>Log In
                                    {/* {error && <span>{error}</span>} */}
                                </button>
                            </Link>
                    </section>
                    
                    </section>
            </form>
    </section>

    )
};
